import * as React from 'react';
import ProfileCard from "./ProfileCard";
import style from './mystyle.module.css';
import {Container, Row, Col} from 'react-bootstrap';

function App(){
  return (
        <Container style={{width: "70%"}}>
          <Row style={{border: '3px solid gray' , padding: '20px', marginBottom: '10px'}}>
            <Col xs={12} md={12}>Perofessional Experiences</Col>
          </Row>
          <Row>
            <Col xs={3} md={4}>
              <ProfileCard professionalExperience="Web Developer"/>
            </Col>
            <Col xs={3} md={4}>
              <ProfileCard professionalExperience="Data Analysis"/>
            </Col>
            <Col xs={3} md={4}>
              <ProfileCard professionalExperience="Librarian"/>
            </Col>
          </Row>
        </Container>

  );
}

export default App;
